Account ledger under which this tax will be booked\n3. Cost Center: If the tax / charge is an income (like shipping) or expense it needs to be booked against a Cost Center.\n4. Description: Description of the tax (that will be printed in invoices / quotes).\n5. Rate: Tax rate.\n6. Amount: Tax amount.\n7. Total: Cumulative total to this point.\n8. Enter Row: If based on \"Previous Row Total\" you can select the row number which will be taken as a base for this calculation (default is the previous row).\n9. Consider Tax or Charge for: In this section you can specify if the tax / charge is only for valuation (not a part of total) or only for total (does not add value to the item) or for both.\n10. Add or Deduct: Whether you want to add or deduct the tax.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Master','icon-money',NULL,NULL,NULL,NULL,NULL,NULL,NULL),('Quality Inspection','2013-04-30 13:13:03.000000','2014-06-23 07:55:51.183113','Administrator','Administrator',0,NULL,NULL,NULL,1,'item_code, report_date, purchase_receipt_no, delivery_note_no',NULL,NULL,NULL,'Buying',NULL,'naming_series:',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'icon-search',NULL,NULL,NULL,NULL,1,NULL,NULL),('Quality Inspection Reading','2013-02-22 01:27:43.000000','2013-12-20 19:23:39.000000','Administrator','Administrator',0,NULL,NULL,NULL,1,NULL,NULL,1,NULL,'Buying',NULL,'QASD/.#####',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('Quotation','2013-05-24 19:29:08.000000','2014-08-12 05:04:36.157045','Administrator','Administrator',0,NULL,NULL,NULL,1,'status,transaction_date,customer,lead,order_type',NULL,NULL,NULL,'Selling',NULL,'naming_series:',NULL,NULL,'modified','DESC',NULL,NULL,NULL,NULL,NULL,NULL,NULL