INSERT INTO `tabPrint Format` VALUES ('Cheque Printing Format','2012-04-11 13:16:56.000000','2014-07-21 08:53:57.749885','Administrator','Administrator',0,NULL,NULL,NULL,1,'Journal Voucher','Accounts','Yes',NULL,'<div style=\"position: relative\">\n\n	{% if letter_head and not no_letterhead %}{{ letter_head }}{%- endif -%}\n	<h4>{{ _(\"Payment Advice\") }}</h4>\n	<div class=\"row\">\n	  <div class=\"col-sm-3\"><label>{{ _(\"To\") }}:</label></div>\n	  <div class=\"col-sm-9\">{{ doc.pay_to_recd_from }}</div>\n	</div>\n	<div class=\"row\">\n	  <div class=\"col-sm-3\"><label>{{ _(\"Voucher No\") }}:</label></div>\n	  <div class=\"col-sm-9\">{{ doc.name }}</div>\n	</div>\n	<div class=\"row\">\n	  <div class=\"col-sm-3\"><label>{{ _(\"Voucher Date\") }}:</label></div>\n	  <div class=\"col-sm-9\">{{ frappe.utils.formatdate(doc.voucher_date) }}</div>\n	</div>\n	<div class=\"row\">\n	  <div class=\"col-sm-3\"><label>{{ _(\"Reference / Cheque No\") }}:</label></div>\n	  <div class=\"col-sm-9\">{{ doc.cheque_no }}</div>\n	</div>\n	<div class=\"row\">\n	  <div class=\"col-sm-3\"><label>{{ _(\"Reference / Cheque Date\") }}:</label></div>\n	  <div class=\"col-sm-9\">{{ frappe.utils.formatdate(doc.cheque_date) }}</div>\n	</div>\n	<div class=\"row\">\n	  <div class=\"col-sm-3\"><label>{{ _(\"Voucher Date\") }}:</label></div>\n	  <div class=\"col-sm-9\">{{ frappe.utils.formatdate(doc.voucher_date) }}</div>\n	</div>\n	<br>\n	<p>{{ _(\"This amount is in full / part settlement of the listed bills\") }}:</p>\n	<hr>\n	<div class=\"row\">\n	  <div class=\"col-sm-3\"><label>{{ _(\"Total Amount\") }}:</label></div>\n	  <div class=\"col-sm-9\">{{ \n	  	frappe.format_value(doc.total_amount, doc.meta.get_field(\"total_amount\"), doc) }}</div>\n	</div>\n	<div class=\"row\">\n	  <div class=\"col-sm-3\"><label>{{ _(\"References\") }}:</label></div>\n	  <div class=\"col-sm-9\">{{ doc.remark }}</div>\n	</div>\n\n	<div style=\"position: absolute; top: 14cm; left: 0cm;\">\n		Prepared By</div>\n	<div style=\"position: absolute; top: 14cm; left: 5.5cm;\">\n		Authorised Signatory</div>\n	<div style=\"position: absolute; top: 14cm; left: 11cm;\">\n		Received Payment as Above</div>\n	<div style=\"position: absolute; top: 16.4cm; left: 5.9cm;\">\n		<strong>_____________</strong></div>\n	<div style=\"position: absolute; top: 16.7cm; left: 6cm;\">\n		<strong>A/C Payee</strong></div>\n	<div style=\"position: absolute; top: 16.7cm; left: 5.9cm;\">\n		<strong>_____________</strong></div>\n	<div style=\"position: absolute; top: 16.9cm; left: 12cm;\">\n		{{ frappe.utils.formatdate(doc.cheque_date) }}</div>\n	<div style=\"position: absolute; top: 17.9cm; left: 1cm;\">\n		{{ doc.pay_to_recd_from }}</div>\n	<div style=\"position: absolute; top: 18.6cm; left: 1cm; width: 7cm;\">\n		{{ doc.total_amount_in_words }}</div>\n	<div style=\"position: absolute; top: 19.7cm; left: 12cm;\">\n		{{ doc.total_amount }}</div>\n</div>',NULL),('Payment Receipt Voucher','2012-05-01 12:46:31.000000','2014-07-21 08:53:17.393966','Administrator','Administrator',0,NULL,NULL,NULL,1,'Journal Voucher','Accounts','Yes',NULL,'<h3 class=\"text-center\">{{ doc.select_print_heading or _(\"Payment Receipt Note\") }}</h3>\n<hr>\n<div class=\"row\">\n  <div class=\"col-sm-3\"><label>{{ _(\"Receipt No\") }}:</label></div>\n  <div class=\"col-sm-9\">{{ doc.name }}</div>\n</div>\n<div class=\"row\">\n  <div class=\"col-sm-3\"><label>{{ _(\"Received On\") }}:</label></div>\n  <div class=\"col-sm-9\">{{ frappe.utils.formatdate(doc.voucher_date) }}</div>\n</div>\n<div class=\"row\">\n  <div class=\"col-sm-3\"><label>{{ _(\"Remark\") }}:</label></div>\n  <div class=\"col-sm-9\">{{ doc.remark }}</div>\n</div>\n<div class=\"row\">\n  <div class=\"col-sm-3\"><label>{{ _(\"Received From\") }}:</label></div>\n  <div class=\"col-sm-9\">{{ doc.pay_to_recd_from }}</div>\n</div>\n<div class=\"row\">\n  <div class=\"col-sm-3\"><label>{{ _(\"Total Amount\") }}:</label></div>\n  <div class=\"col-sm-9\">{{ doc.total_amount }}<br>{{ doc.total_amount_in_words }}</div>\n</div>\n<br>\n<p>\n{{ _(\"For\") }} {{ doc.company }},<br>\n<br>\n<br>\n<br>\n{{ _(\"Authorized Signatory\") }}</p>','Server'),('POS Invoice','2011-12-21 11:08:55.000000','2014-07-22 02:08:26.603223','Administrator','Administrator',0,NULL,NULL,NULL,1,'Sales Invoice','Accounts','Yes',NULL,'<style>\n	.print-format table, .print-format tr, \n	.print-format td, .print-format div, .print-format p {\n		font-family: Monospace;\n		line-height: 200%;\n		vertical-align: middle;\n	}\n	@media screen {\n		.print-format {\n			width: 4in;\n			padding: 0.25in;\n			min-height: 8in;\n		}\n	}\n</style>\n\n<p class=\"text-center\">\n	{{ doc.company }}<br>\n	{{ doc.select_print_heading or _(\"Invoice\") }}<br>\n</p>\n<p>\n	<b>{{ _(\"Receipt No\") }}:</b> {{ doc.name }}<br>\n	<b>{{ _(\"Date\") }}:</b> {{ doc.get_formatted(\"posting_date\") }}<br>\n	<b>{{ _(\"Customer\") }}:</b> {{ doc.customer_name }}\n</p>\n\n<hr>\n<table class=\"table table-condensed cart no-border\">\n	<thead>\n		<tr>\n			<th width=\"60%\">{{ _(\"Item\") }}</b></th>\n			<th width=\"10%\" class=\"text-right\">{{ _(\"Qty\") }}</th>\n			<th width=\"30%\" class=\"text-right\">{{ _(\"Rate\") }}</th>\n		</tr>\n	</thead>\n	<tbody>\n		{%- for item in doc.entries -%}\n		<tr>\n			<td>\n				{{ item.item_code }}\n				{%- if item.item_name != item.item_code -%}\n					<br>{{ item.item_name }}{%- endif -%}\n			</td>\n			<td class=\"text-right\">{{ item.qty }}</td>\n			<td class=\"text-right\">{{ item.amount }}</td>\n		</tr>\n		{%- endfor -%}\n	</tbody>\n</table>\n<table class=\"table table-condensed no-border\">\n	<tbody>\n		<tr>\n			<td class=\"text-right\" style=\"width: 70%\">\n				{{ _(\"Net Total\") }}\n			</td>\n			<td class=\"text-right\">\n				{{ doc.get_formatted(\"net_total_export\") }}\n			</td>\n		</tr>\n		{%- for row in doc.other_charges -%}\n		{%- if not row.included_in_print_rate -%}\n		<tr>\n			<td class=\"text-right\" style=\"width: 70%\">\n				{{ row.description }}\n			</td>\n			<td class=\"text-right\">\n				{{ row.get_formatted(\"tax_amount\", doc) }}\n			</td>\n		</tr>\n		{%- endif -%}\n		{%- endfor -%}\n		{%- if doc.discount_amount -%}\n		<tr>\n			<td class=\"text-right\" style=\"width: 70%\">\n				{{ _(\"Discount\") }}\n			</td>\n			<td class=\"text-right\">\n				{{ doc.get_formatted(\"discount_amount\") }}\n			</td>\n		</tr>\n		{%- endif -%}\n		<tr>\n			<td class=\"text-right\" style=\"width: 70%\">\n				<b>{{ _(\"Grand Total\") }}</b>\n			</td>\n			<td class=\"text-right\">\n				{{ doc.get_formatted(\"grand_total_export\") }}\n			</td>\n		</tr>\n	</tbody>\n</table>\n{% if doc.get(\"other_charges\", filters={\"included_in_print_rate\": 1}) %}\n<hr>\n<p><b>Taxes Included:</b></p>\n<table class=\"table table-condensed no-border\">\n	<tbody>\n		{%- for row in doc.other_charges -%}\n		{%- if row.included_in_print_rate -%}\n		<tr>\n			<td class=\"text-right\" style=\"width: 70%\">\n				{{ row.description }}\n			</td>\n			<td class=\"text-right\">\n				{{ row.get_formatted(\"tax_amount\", doc) }}\n			</td>\n		<tr>\n		{%- endif -%}\n		{%- endfor -%}\n	</tbody>\n</table>\n{%- endif -%}\n<hr>\n<p>{{ doc.terms or \"\" }}</p>\n<p class=\"text-center\">{{ _(\"Thank you, please visit again.\") }}</p>','Server');
