ortis nisl ut aliquip ex ea commodo consequat.</p>\n		</div>\n	</div>\n</div>\n<p class=\"text-center\" style=\"margin-bottom: 50px;\">\n	<a href=\"/products\" class=\"btn btn-success\">Explore <i class=\"icon-chevron-right\"></i></a>\n</p>\n<!-- no-sidebar -->',NULL,1);
